import Radio from './radio/Radio';

function RadioButtons(){
	const current = new Date();
	const year = current.getFullYear();
	const month = current.getMonth() + 1;
	const day = current.getDate();

	function handleClick(e) {
		console.log('clickedaaa')
	}

	return (
		<section>
			{year}
			{month}
			{day}
			<ul>
				<li><Radio name='timeScale' id='li1' text='This year' onChange={handleClick}/></li>
				<li><Radio name='timeScale' id='li2' text='This month'/></li>
				<li><Radio name='timeScale' id='li3' text='This week'/></li>
				<li><Radio name='timeScale' id='li4' text='Yesterday'/></li>
				<li><Radio name='timeScale' id='li5' text='Last year'/></li>
				<li><Radio name='timeScale' id='li6' text='Last month'/></li>
				<li><Radio name='timeScale' id='li7' text='Last week'/></li>
				<li><Radio name='timeScale' id='li8' text='Other'/></li>
			</ul>
		</section>
	);
}

export default RadioButtons;
